import React, { useState, useEffect } from 'react';
import io from 'socket.io-client';

const SocketingComponent = () => {

    useEffect(() => {
        // Establish a connection to the server
        const socket = io();

        // Handle the 'connect' event
        socket.on('connect', () => {
            console.log('Connected to the server');
        });

        // Handle the 'connect' event from the server
        socket.on('connect', (data) => {
            console.log(data);
        });
        // Clean up the socket connection when the component unmounts
        return () => {
            socket.disconnect();
        };
        // The empty dependency array [] ensures the effect runs only once when component is mounted
    }, []);


    return (
        <div>
            Socketing Component
            {/* <CodeNames /> */}
        </div>
    );
};

export default SocketingComponent;


